// import PropTypes from 'prop-types';
// import css from './TransactionHistory.module.css';


export default function TransactionHistory ({items}){
  return (

    <table className="transaction-history">
    <thead>
      <tr>
        <th>Type</th>
        <th>Amount</th>
        <th>Currency</th>
      </tr>
    </thead>
  
    <tbody>{items.map()}
      <tr key={item.id}>
        <td>Invoice</td>
        <td>125</td>
        <td>USD</td>
      </tr>
    </tbody>
  </table>
  )
}
